If you are concerned make a backup of your decks before using the add-on. To get the colours in the screenshots, add these codes to the card styling (CSS) .kv_kanji_known, .kv_kanji_mature {
background-color: #40ff40
} .kv_kana_known, .kv_kana_mature {
background-color: #ffff40
} .kv_confuse {
color: #ff0000
} .kv_likely {
color: #800080
} Vocab card scanning is self-contained. Text scanning requires a recent version of the " Japanese Support " addon.
